<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Test</title>
	<!--#include file="/SystemFragment/global/pc_global_css_js.html" -->

</head>

<body>
    <div class="content">
        <div class="item"></div>
        <div class="item"></div>
        <div class="item">
            <div class="popup"></div>
        </div>
    </div>
    <div class="bottomStickyDock">
        <div class="compareDockContainer">
            <div class="checkapp content flexBetween">
                <div class="left">
                    <div id="compareDockContainer_feedback_telium"
                        class="Litem compareDockContainer_feedback_telium feedback flexCenter blue"></div>
                    <div tabindex="0" class="Litem compareDockContainer_compare_count compare flexCenter blue">
                        <i class="icon compareIcon"></i>
                        <font class="compareText" data-tkey="compare.text">
                            <#compare.text#>
                                <!--Compare-->
                        </font>&nbsp;(<span class='sticky_dock_compare_count blue'></span>)
                    </div>
                    <a id="compareDockContainer_cookie" class="Litem cookieContent flexCenter" href="">
                        <i class="icon cookieIcon"></i>
                        <span class="cookieText" data-tkey="Cookies"><#Cookies#></span>
                        <i class="icon arrowTop"></i>
                    </a>
                </div>
                <div class="right">
                    <div class="contact flexCenter">
                        <a class="contactButton flexCenter" role="button" href="">
                            <i class="icon contactIcon"></i>
                            <span data-tkey="Call"><#Call#></span>
                        </a>
                        <pre class="compareTalkLabel"><#stickybar.help.msg#></pre>
                        <span class="compareDockContainer_phoneno"></span>
                    </div> 
                    <div tabindex="0" id="compareDockContainer_chatNow_telium"
                        class="checkapp compareDockContainer_chatNow_telium chatNow flexCenter"></div>
                </div>
            </div>
            
        </div>
        <button class="back2top" aria-label="back to top button"></button>
    </div>
</body>

</html>
